- uid: SuperOffice.Data.Cache.CacheBaseV2.InstanceDispose
  commentId: M:SuperOffice.Data.Cache.CacheBaseV2.InstanceDispose
  id: InstanceDispose
  parent: SuperOffice.Data.Cache.CacheBaseV2
  langs:
  - csharp
  - vb
  name: InstanceDispose()
  nameWithType: CacheBaseV2.InstanceDispose()
  fullName: SuperOffice.Data.Cache.CacheBaseV2.InstanceDispose()
  type: Method
  assemblies:
  - SoDataBase
  namespace: SuperOffice.Data.Cache
  summary: >-
    Dispose of the cache.

    <b>NOTE</b> - the data in the cache should be left untouched
  remarks: >-
    Someone may be using the cache, even if it is being 'disposed' here. The meaning of dispose is 'this is no longer

    the current instance of this cache'; so it's taken out of all the lifetime and notification mechanisms. However,

    the principle of immutability means that the <b>content</b> of the cache should not be changed. <br />

    Clients that do SomeCache.GetCurrent().GetSomething() may well have a thread in the GetSomething method and

    it would be very bad to interrupt that. There the cleanup of the cache object is left to the garbage collector,

    who knows when it is actually unreferenced. And once that happens no-one can get hold of it again.
  example: []
  syntax:
    content: public void InstanceDispose()
    content.vb: Public Sub InstanceDispose()
  overload: SuperOffice.Data.Cache.CacheBaseV2.InstanceDispose*
